import axios from 'axios';

const url = 'http://localhost:5000/posts';


export const getPosts = () => axios.get(`${url}/getPosts`);
export const createPost = (newPost) => axios.post(
    {
        method: 'post',
        url: `${url}/createPost`,
        data: newPost,
    });
